import { GoogleSpreadsheet } from "google-spreadsheet";

// Fetch a Google Sheet
export async function getSheet(sheetLink) {
    const sheetID = sheetLink.slice(sheetLink.lastIndexOf("/d/") + 3, sheetLink.lastIndexOf('/edit#'));
    const pageID = sheetLink.slice(sheetLink.lastIndexOf("gid=") + 4, sheetLink.length);
    console.log(sheetID);
    console.log(pageID);
    const doc = new GoogleSpreadsheet(sheetID);
    await doc.useServiceAccountAuth({
      client_email: process.env.REACT_APP_SHEETS_CLIENT_EMAIL,
      private_key: process.env.REACT_APP_SHEETS_PRIVATE_KEY,
    });
    await doc.loadInfo();
    console.log(doc.title);

    const sheet = doc.sheetsByIndex[0];
    console.log(sheet.title);
  }
